import DropdowMenu from "./DropdownMenu";

export const Navbar = () => {
  return (
    <nav className="navbar">
      <div>
        <DropdowMenu />
      </div>
      <div>
        <input type="search" placeholder="Search product..." />
      </div>
      <div>
        <button>My account</button>
      </div>
      <div>
        <button>Favorites</button>
      </div>
      <div>
        <button>Cart</button>
      </div>
    </nav>
  );
};
